import React, { useEffect, useState } from "react";
import { useNavigate, Link } from "react-router-dom";
import {
  handleSuccess,
  handleError,
  ToastContainer,
} from "../utils/ReactToastify";
import "../assets/style/ReactToastifyCustom.css";
import "../assets/style/animations.css";
import logo from "../assets/images/logo.png";

const Signup = () => {
  const navigate = useNavigate();
  const [formData, setFormData] = useState({
    firstName: "",
    lastName: "",
    email: "",
    password: "",
    confirmPassword: "",
    phoneNumber: "",
    dateOfBirth: "",
    gender: "",
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevFormData) => ({
      ...prevFormData,
      [name]: value,
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    const {
      firstName,
      lastName,
      email,
      password,
      confirmPassword,
      phoneNumber,
      dateOfBirth,
      gender,
    } = formData;

    if (password !== confirmPassword) {
      handleError("Passwords do not match!");
      return;
    }

    const signUpData = {
      firstName,
      lastName,
      email,
      password,
      phoneNumber,
      dateOfBirth,
      gender,
    };

    try {
      const response = await fetch("http://localhost:5000/api/signup", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(signUpData),
      });

      if (response.ok) {
        handleSuccess("Signup successful! Redirecting...");
        setTimeout(() => {
          navigate("/login");
        }, 2000);
      } else {
        const errorData = await response.json();
        handleError(errorData.message || "Signup failed.");
      }
    } catch (error) {
      console.error("Error during signup:", error);
      handleError("Signup failed due to an unexpected error.");
    }
  };

  return (
    <div className="signup-page-container">
      <img src={logo} alt="Logo" className="application-logo" />
      <div className="main-container">
        <h1>Create Your Account</h1>
        <form onSubmit={handleSubmit}>
          <div className="form-group-wrapper">
            <div className="single-form-group-wrapper">
              <input
                type="text"
                className="input-field"
                placeholder=" "
                name="firstName"
                value={formData.firstName}
                onChange={handleChange}
                required
              />
              <label className="form-label">First Name</label>
            </div>
            <div className="single-form-group-wrapper">
              <input
                type="text"
                className="input-field"
                placeholder=" "
                name="lastName"
                value={formData.lastName}
                onChange={handleChange}
                required
              />
              <label className="form-label">Last Name</label>
            </div>
          </div>
          <div className="signup-form-group-wrapper">
            <input
              type="email"
              className="input-field"
              placeholder=" "
              name="email"
              value={formData.email}
              onChange={handleChange}
              required
            />
            <label className="form-label">Email</label>
          </div>
          <div className="signup-form-group-wrapper">
            <input
              type="password"
              className="input-field"
              placeholder=" "
              name="password"
              value={formData.password}
              onChange={handleChange}
              required
            />
            <label className="form-label">Password</label>
          </div>
          <div className="signup-form-group-wrapper">
            <input
              type="password"
              className="input-field"
              placeholder=" "
              name="confirmPassword"
              value={formData.confirmPassword}
              onChange={handleChange}
              required
            />
            <label className="form-label">Confirm Password</label>
          </div>
          <div className="signup-form-group-wrapper">
            <input
              type="text"
              className="input-field phone-number-input"
              placeholder=" "
              name="phoneNumber"
              value={formData.phoneNumber}
              onChange={handleChange}
              required
            />
            <label className="form-label">Phone Number</label>
          </div>
          <div className="signup-form-group-wrapper">
            <input
              type="date"
              className="input-field"
              placeholder=" "
              name="dateOfBirth"
              value={formData.dateOfBirth}
              onChange={handleChange}
              required
            />
            <label className="form-label">Date of Birth</label>
          </div>
          <div className="signup-form-group-wrapper">
            <select
              className="input-field"
              name="gender"
              value={formData.gender}
              onChange={handleChange}
              required
            >
              <option value="">Select Gender</option>
              <option value="male">Male</option>
              <option value="female">Female</option>
              <option value="other">Other</option>
            </select>
            <label className="form-label">Gender</label>
          </div>
          <button type="submit" className="button signup-submit-button">
            Sign Up
          </button>
          <span className="terms-text">
            By signing up, you agree to our{" "}
            <Link to="/terms" className="terms-navigation-link">
              Terms of Service
            </Link>{" "}
            and{" "}
            <Link to="/privacy" className="terms-navigation-link">
              Privacy Policy
            </Link>
            .
          </span>
          <div className="bottom-box-wrapper">
            <span className="text-span">Already have an account?</span>
            <Link to="/login" className="page-navigation-link">
              Login
            </Link>
          </div>
        </form>
        <ToastContainer />
      </div>
    </div>
  );
};

export default Signup;
